    mod = 7 ** 10
    M = N
    N = M // 30
    res = 0
    for i in range(1, 31):
        if pow(2, i, 10) == 1 or pow(2, i, 10) == 6:
            res += (3 * i * N + 3 * N * (N + 1) / 2) % mod
        else:
            res += (3 * N * (N + 1) // 2 * i + 2 * N) % mod
